import React from 'react'

const button = ({ styles }) => {
  return (
    <button type="button" className={`py-4 px-6 bg-blue-gradient
    font-poppins font-medium text-[18px] text-primary outline-none
    ${styles} rounded-[10px]`}>
      Get Started
    </button>
  );
}
export default button
